import React from "react";
import "./TechSkills.css";

const techSkillsData = [
  { name: "Python", percentage: 90 },
  { name: "Django", percentage: 85 },
  { name: "React.js", percentage: 80 },
  { name: "Node.js", percentage: 75 },
  { name: "MySQL", percentage: 70 },
  { name: "Git", percentage: 65 },
];

const TechSkills = ({ theme }) => {
  return (
    <div className="tech-skills-container" style={{ backgroundColor: theme.body }}>
      <h2 className="tech-skills-heading" style={{ color: theme.text }}>
        Technical Skills
      </h2>
      <div className="tech-skills-grid">
        {techSkillsData.map((skill, index) => (
          <div className="tech-skill-card" key={index}>
            <div className="tech-skill-name" style={{ color: theme.text }}>{skill.name}</div>
            <div className="tech-progress-bar">
              <div
                className="tech-progress"
                style={{
                  width: `${skill.percentage}%`,
                  backgroundColor: theme.accentColor,
                }}
              ></div>
            </div>
            <div className="tech-percentage" style={{ color: theme.text }}>{skill.percentage}%</div>
          </div>
        ))}
      </div>
    </div>
  );
};

export default TechSkills;
